import React, { Component } from 'react';
import '../App.css';
import {Link} from  'react-router-dom';
import {retrieveMotherboards} from '../actions/actions';
import { Button } from 'react-bootstrap';
class Motherboard extends Component{
    constructor(props){
        super(props);
        // This binding is necessary to make `this` work in the callback
        this.state = {
            data: []
        };
        this.pricesum3 = 0;
        this.name = "";
      }
      componentDidMount(){
          this.fetchMotherboards();
    }
    fetchMotherboards = () => {
        retrieveMotherboards().then(res =>{ 
            this.setState({data:res});
        }).catch(err => {
            alert('Failed to fetch Motherboards! '+err);
        });
      }
      selectMotherboard = item => event => {
          event.preventDefault();
          const {name} = this.props.location.state;
          const {CPU} = this.props.location.state;
          const {GPU} = this.props.location.state;
          const {RAM} = this.props.location.state;
          const {Storage} = this.props.location.state;
          const {pricesum3} = this.props.location.state;
          let Motherboard = item.Moth_Name;
          let pricesum4 = parseFloat(item.Price) + parseFloat(pricesum3);
          alert("Motherboard Selected: "+item.Moth_Name);
          this.props.history.push("/psu",{
              name:name,
              CPU:CPU,
              GPU:GPU,
              RAM:RAM,
              Storage:Storage,
              Motherboard:Motherboard,
              Price: item.Price,
              pricesum4: pricesum4
          });
      }
      render() {
        const {pricesum3} = this.props.location.state;
        let rows = [];
        const {name} = this.props.location.state;
        this.name = name;
        this.pricesum3 = pricesum3;
        const contents = this.state.data.forEach((item, key) => {
          if(key % 2 === 0)
          {
            rows.push(<tr className='Odd-Row'>
            <td>{item.Moth_ID}</td>
            <td>{item.Moth_Name}</td>
            <td>{item.Price}</td>
            <td><button id={item} className="btn" onClick={this.selectMotherboard(item)}>Select MB</button></td>
            </tr>);
          }else{
            rows.push(<tr className='Even-Row'>
          <td>{item.Moth_ID}</td>
            <td>{item.Moth_Name}</td>
            <td>{item.Price}</td>
            <td><button id={item} className="btn" onClick={this.selectMotherboard(item)}>Select MB</button></td>
            </tr>);
          };
     });
        return (
          <div className="container">
              <br></br>
              <div className="form-group">
              <h2 class="text-center mb-3" className="Label"><i class="fas fa-sign-in-alt"></i> Please Select a Motherboard Option
            </h2>
            <br></br>
            <Link className="link" to={{
                pathname:'/storage',
                state:{name: this.name, price: this.pricesum3}
            }}> Back to Storage Page </Link>
            <br></br>
              </div>
            <table className="table table-striped">
              <thead>
              <tr className='Table-header'>
                <th>MOTHERBOARD NB</th>
                <th>MOTHERBOARD NAME</th>
                <th>PRICE $</th>
                <th>MOTHERBOARD SELECTION</th>
              </tr>
              </thead>
              {rows}
            </table>
            <br></br>
            <h5 class="text-center mb-3" className="Label"><i class="fas fa-sign-in-alt"></i><b>
            NDXHardware™</b> 
            </h5>
            <br></br>
          </div>
        );
      }
  }
export default Motherboard;
